import L from 'leaflet';

const iconArrow = new L.Icon({
    iconUrl: require('./navigation.svg'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(60, 75),
    className: 'leaflet-div-icon'
});

export default { iconArrow };
